INSERT INTO public.pages (id, slug, title, content, page_group_id, created_at, updated_at) VALUES (1, 'board', 'Board', '<p><strong>11th Board of H.V. Ockham (2019-2020)</strong></p><figure class="image"><img src="data:image/png;base64,"></figure><p>Kenneth Weisbeek, Chairman<br>Mart Wubbels, Secretary<br>Melvin Willems, Treasurer<br>Atis Kazaferi, Internal Affairs<br>Erik Bösert, External Affairs</p><p><strong>10th Board of H.V. Ockham (2018-2019)</strong></p><figure class="image"><img src="data:image/png;base64,"></figure><p>Sander Oosterveld, Chairman and External Affairs<br>Remco Abraham, Secretary<br>Bilge Tekeş, Treasurer<br>Eline Uiterweerd, Internal Affairs</p><p><strong>9th Board of H.V. Ockham (2017-2018)</strong></p><figure class="image"><img src="data:image/png;base64,"></figure><p>Marleen van Hoorn, Chairman<br>Idwer de Vries, Secretary<br>Pauline Oonk, Treasurer<br>Luuk Buunk, Internal Affairs<br>Varun Sudhakar, External Affairs</p><p><strong>8th Board of H.V. Ockham (2016-2017)</strong></p><figure class="image"><img src="data:image/png;base64,"></figure><p>Thijs Lieverse, Chairman<br>Martin Essink, Secretary<br>Anne Schrader, Treasurer<br>Dieuwke Maas, Internal Affairs<br>Guido Ritsema van Eck, External Affairs</p><p><strong>7th Board of H.V. Ockham (2015-2016)</strong></p><figure class="image"><img src="https://www.hv-ockham.nl/sites/default/files/images/7th_boardHVOckham.png" alt=""></figure><p>Yorick Fredrix, Chairman<br>Saumitra Athlekar, Secretary<br>Liset de Bruin, Treasurer<br>Hanna de Wolf, Internal Affairs<br>Fernon Eijkhoudt, External Affairs</p><p><strong>6th Board of H.V. Ockham (2014-2015)</strong></p><figure class="image"><img src="https://www.hv-ockham.nl/sites/default/files/images/6th_BoardHVOckham.png" alt=""></figure><p>Rianne van Dommelen, Chairman<br>Chantal Molenwijk, Secretary<br>Ronald Jong, Treasurer<br>Jaap Slootbeek, Internal Affairs<br>Noor Godijk, External Affairs</p><p><strong>5th Board of H.V. Ockham (2013-2014)</strong></p><figure class="image"><img src="https://www.hv-ockham.nl/sites/default/files/images/5th_BoardHVOckham.png" alt=""></figure><p>Rik de Ruiter, Chairman<br>Michelle Jansman, Secretary<br>Anna Nielsen, Treasurer<br>Belinda Brandwacht, Internal Affairs<br>Nathalie Geerlings, External Affairs</p><p><strong>4th Board of H.V. Ockham (2012-2013)</strong><br>Bastiaan Bruinsma, Chairman<br>Julius de Hond, Secretary<br>Lieke Hermans, Treasurer<br>Maura Dantuma, Internal Affairs<br>Marieke Olsman, External Affairs</p><p><strong>3rd Board of H.V. Ockham (2011-2012)</strong><br>Rogier Wildeboer,&nbsp;Chairman<br>Marinke van der Helm,&nbsp;Secretary<br>Jessica Steur,&nbsp;Treasurer<br>Eva Leemans,&nbsp;Internal affairs<br>Iris van den Nieuwenhuizen,&nbsp;External affairs</p><p><strong>2nd Board of H.V. Ockham (2010-2011)</strong><br>Gideon Simmelink, Chairman<br>Roy van Koten, Secretary<br>Anne Garretsen, Treasurer<br>Kei Long Cheung, General affairs</p><p><strong>1st Board of H.V. Ockham (2009-2010)</strong><br>Remco Bloemen, Chairman<br>Arvid Keemink, Secretary<br>Joke Noppers, Treasurer<br>Anton van der Stoep, General affairs<br>Yori Kamphuis, External Affairs</p>', 1, '2020-04-03 20:14:15', '2020-04-03 20:15:30');
INSERT INTO public.pages (id, slug, title, content, page_group_id, created_at, updated_at) VALUES (2, 'vision', 'Vision', '<figure class="image"><img src="https://www.hv-ockham.nl/sites/default/files/images/vision-mission-banner-960x209.png"></figure><p><br>H.V. Ockham looks after the interests of all the students following a Honours of Excellence Programme at the University of Twente. Moreover, by organizing a wide range of activities, we try to widen and stimulate the interests of our members. In doing so, we develop a thriving academic community at the University of Twente.</p><p>Any student who wishes to expand her or his ambition on any grounds&nbsp;can count on the support of Ockham. To ensure this, we organize networking activities, public readings, and career talks of former members. We collaborate&nbsp;closely with the University to keep on supporting excellent students and keep chasing their ambitions.</p><p><strong>That is our vision, and we&nbsp;stay true to it.</strong></p>', 1, '2020-04-03 20:16:46', '2020-04-03 20:16:46');
INSERT INTO public.pages (id, slug, title, content, page_group_id, created_at, updated_at) VALUES (3, 'honorary-members', 'Honorary Members', '<p><strong>Fokko Jan Dijksterhuis</strong></p><p>Every canonically great scientist is a “dead white man”. While this is not uncontroversial, insights like these summarize Fokko Jan’s teaching style: witty, thought-provoking and enthusiastic, he has made the bachelor Science track memorable for many cohorts of honours students. Like the other honorary members, he has also played an essential role in establishing the Honours Programme as we know it and has always stayed involved with the honours community and Ockham. Fokko Jan has helped Ockham reach out to new students, and was asked to open the Ockham room for the first time in early 2015.</p><p>Fokko Jan’s honorary membership was approved during the annual general members meeting of 2015. At a lunch lecture he gave to Ockham’s members about the Dutch mathematician Simon Stevin, he received his honorary membership. With this honorary membership, H.V. Ockham wants to thank him for his contribution to the Honours Programme and his continued support for the honours community.</p><figure class="image"><img src="https://www.hv-ockham.nl/sites/default/files/images/FokkoJanDijksterhuis.png"></figure><p>&nbsp;</p><p><strong>Miko Elwenspoek</strong></p><p>Name a subject, and Miko has probably read a few books about it. His wide base of knowledge and his eagerness to share it have always made his modules in the Science and Design tracks a joy to follow. In addition to teaching, he has been intensively involved in setting up the Honours Programme. Later on, he remained a driving force behind the Honours Programme and the honours community in his capacities as programme director and dean. While he ‘officially’ retired in 2013, Miko continued working as dean of the Honours Programme until the end of 2016 and still teaches. Miko’s support and advice have been valuable to Ockham since the beginning, and he remains a welcome sight in the Ockham room to this day.</p><p>Miko received his honorary membership on January 13th, 2014. With this honorary membership, H.V. Ockham wants to thank Miko for his great dedication to the Honours Programme and the honours community.</p><figure class="image"><img src="https://www.hv-ockham.nl/sites/default/files/images/MikoElwenspoek.png"></figure><p>&nbsp;</p><p><strong>Henk Procee</strong><br><span style="color:rgb(96,96,96);">Henk Procee was involved in the Honours Programme right from the beginning. He taught several modules with great enthusiasm and was always in for a good conversation. In 2011 he ‘officially’ retired and stopped teaching after finishing the module ‘Synthese’ with the 5th generation honours students at the Honours Programme. On February 22th (2012) during the graduation ceremony of the 5th generation, he was asked by the third board of HV Ockham to become the first honorary member of HV Ockham. Of course, he felt really honoured and did not refuse the offer. At September his honourary membership became official after it was approved during the annual general members meeting. With this honorary membership, HV Ockham wants to thank Henk Procee for everything that he has done for the honours community.</span></p><figure class="image"><img src="data:image/png;base64,"></figure>', 1, '2020-04-03 20:19:14', '2020-04-03 20:19:14');
INSERT INTO public.pages (id, slug, title, content, page_group_id, created_at, updated_at) VALUES (4, 'association-song', 'Association Song', '<p><strong>The Ockham Song</strong><br><span style="color:rgb(96,96,96);">Ockham, singing our song aloud,</span><br><span style="color:rgb(96,96,96);">We’re standing very proud,</span><br><span style="color:rgb(96,96,96);">We’re simply the best.</span><br><br><span style="color:rgb(96,96,96);">Ockham, Honours at the UT,</span><br><span style="color:rgb(96,96,96);">We don’t need modesty,</span><br><span style="color:rgb(96,96,96);">We are the best.</span><br><br><span style="color:rgb(96,96,96);">Ambition no no no we don’t lack that,</span><br><span style="color:rgb(96,96,96);">Excellent ha ha ha we’re supreme,</span><br><span style="color:rgb(96,96,96);">Cultural hey hey hey we’re diverse,</span><br><span style="color:rgb(96,96,96);">We’re first class, we’re superb, we’re the best!</span><br><br><span style="color:rgb(96,96,96);">Ockham, Ockham, home of the philosopher,</span><br><span style="color:rgb(96,96,96);">Who gave us Occams ra-a-zor,</span><br><span style="color:rgb(96,96,96);">Wîlliam was his name. (Hey!)</span><br><br><span style="color:rgb(96,96,96);">Ockham, Ockham, we are connoisseurs of wine,</span><br><span style="color:rgb(96,96,96);">Our debates are mighty fine,</span><br><span style="color:rgb(96,96,96);">Great minds intertwine. (Hey!)</span><br><br><span style="color:rgb(96,96,96);">Ockham, Ockham, yes we are the very best,</span><br><span style="color:rgb(96,96,96);">Highest scores on every test,</span><br><span style="color:rgb(96,96,96);">Failures we detest. (Hey!)</span><br><br><span style="color:rgb(96,96,96);">Ockham, Ockham 2nd mondays are for beer,</span><br><span style="color:rgb(96,96,96);">Hang-overs we do not fear,</span><br><span style="color:rgb(96,96,96);">We will persevere. (Hey!)</span><br><br><span style="color:rgb(96,96,96);">Ockham, we’ve been here since O‘9,</span><br><span style="color:rgb(96,96,96);">A-head of ou-r time,</span><br><span style="color:rgb(96,96,96);">We were the first.</span><br><br><span style="color:rgb(96,96,96);">Ockham, owls we do not prefer,</span><br><span style="color:rgb(96,96,96);">Our mascot is singular,</span><br><span style="color:rgb(96,96,96);">It’s thé Óckhamster.</span><br><br><span style="color:rgb(96,96,96);">Ambition no no no we don’t lack that,</span><br><span style="color:rgb(96,96,96);">Excellent ha ha ha we’re supreme,</span><br><span style="color:rgb(96,96,96);">Cultural hey hey hey we are diverse,</span><br><span style="color:rgb(96,96,96);">We’re first class, we’re superb, we’re the best!</span><br><br><span style="color:rgb(96,96,96);">Ockham, Ockham, home of the philosopher,</span><br><span style="color:rgb(96,96,96);">Who gave us Occams ra-a-zor,</span><br><span style="color:rgb(96,96,96);">William was his name. (Hey!)</span><br><br><span style="color:rgb(96,96,96);">Ockham, Ockham, we are connaisseurs of wine,</span><br><span style="color:rgb(96,96,96);">Our debates are mighty fine,</span><br><span style="color:rgb(96,96,96);">Great minds intertwine. (Hey!)</span><br><br><span style="color:rgb(96,96,96);">Ockham, Ockham, yes we are the very best,</span><br><span style="color:rgb(96,96,96);">Highest scores on every test,</span><br><span style="color:rgb(96,96,96);">Failures we detest. (Hey!)</span><br><br><span style="color:rgb(96,96,96);">Ockham, Ockham 2nd mondays are for beer,</span><br><span style="color:rgb(96,96,96);">Hangovers we do not fear,</span><br><span style="color:rgb(96,96,96);">We will persevere!</span><br><br><i>The song is based on the music and melody of the song ‘Moskau’ by Dschinghis Khan.</i></p>', 1, '2020-04-03 20:20:03', '2020-04-03 20:20:03');
