INSERT INTO public.pages (id, slug, title, content, page_group_id, created_at, updated_at) VALUES (10, 'thales', 'Thales', '<figure class="image"><img src="data:image/png;base64,"></figure><p>The people we all rely on to make the world go round – they rely on Thales. In a world that is increasingly fast-moving, unpredictable and full of opportunities, they come to us with big ambitions: to make life better and to keep you safer. Combining a unique diversity of expertise, talents and cultures, our employees&nbsp; design and deliver extraordinary high-tech solutions. With 68.000 talents working in 54 countries, 2000 employees are based in the Netherlands. We are one of the biggest high-tech employers in the field of safety and security.<br><br>We help our customers think smarter and act faster in the fields of transportation, defence , space, aerospace&nbsp; and cyberspace, mastering ever-greater complexity and every decisive moment along the way. We are therefore leading the digital transformation, focusing on artificial intelligence, big-data &amp; data analytics, connectivity, mobility and internet of things and cybersecurity.</p><p>In the Netherlands, we are located in four cities: Huizen, Delft, Eindhoven and Hengelo (HQ). Together with an extensive ecosystem of knowledge partners, customers and suppliers, we work on radars for naval vessels, cyber security solutions, transportation systems, communication equipment for land forces, cryogenic cooling solutions, research &amp; development for radar tech (in collaboration with TU Delft) and research &amp; development for serious gaming (in collaboration with the University of Twente).</p><p><strong>Your career at Thales</strong><br>At Thales, we value failure over not trying. You will be free to work on your personal development and growth, your initiatives are important for the future of our company. At Thales, you are in charge of your own career. Vertical, horizontal, diagonal or international; you decide in which direction you will develop yourself.</p><p>As an employee, you help our customers to think smarter and act faster, which makes you our most valuable asset. Therefore, you deserve the best working conditions at Thales. We offer forty days of vacation, a years end bonus, a profit share of the gross annual salary and a lot more.</p><p>At Thales, we value empowerment over control. You are free to design your own job, and together with your multidisciplinary team you are responsible for the right output. We believe a well balanced work-life situation leads to better results. Our open and flexible work environment makes this possible.</p><p>Together, we make sure you enjoy your time at Thales. Besides getting your coffee moment at our own Starbucks, we organize lots of activities, like a ski-trip with our international Young Employee Society and lunch lectures with drinks. For our interns and graduates we have our own student society to give you the best Thales experience.</p><p><strong>Get to know more</strong><br>Are you looking for an interesting job, internship or graduation project within a nice team in an international and high tech environment? Check <a href="http://www.thalescareers.nl/"><span style="color:blue;"><u>www.thalescareers.nl</u></span></a> for the most up-to-date vacancies!</p><p>Do you want to keep up to date with news about Thales and see our vacancies?</p><figure class="image"><img src="https://www.hv-ockham.nl/sites/default/files/images/Thales1.png" alt=""></figure><p>&nbsp; &nbsp;Download the Thales Connect App for <a href="https://itunes.apple.com/ca/app/thales-connect/id1121144720?mt=8"><span style="color:blue;"><u>iOS</u></span></a> or <a href="https://play.google.com/store/apps/details?id=nl.thales.app&amp;hl=en"><span style="color:blue;"><u>Android</u></span></a><br>&nbsp;</p><figure class="image"><img src="https://www.hv-ockham.nl/sites/default/files/images/Thales2.png" alt=""></figure><p>&nbsp; &nbsp;Follow us on <a href="https://www.facebook.com/ThalesNederland/"><span style="color:blue;"><u>Facebook</u></span></a><br>&nbsp;</p><figure class="image"><img src="https://www.hv-ockham.nl/sites/default/files/images/Thales3.png" alt=""></figure><p>&nbsp; &nbsp;Follow us on <a href="https://www.linkedin.com/company/thales"><span style="color:blue;"><u>Linkedin</u></span></a></p>', 2, '2020-04-03 20:53:12', '2020-04-03 21:01:39');
